import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Container, Row, Col } from "react-bootstrap";

function Footer() {
  return (
    <footer className="bg-dark text-center text-white">
      <Container>
        <Row>
          <Col>hi</Col>
        </Row>
      </Container>
    </footer>
  );
}

export default Footer;
